import "./App.css";
import Navbar from "./Components/Navbar"
import Home from "./pages/Home"
import { Route } from "react-router-dom";

function App() {
  return (
    < div >
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
      </Routes>
    </ div >
  )

}

export default App;
